import React from "react";
import CustomButton from "./button";
import { AddCircle } from "@mui/icons-material";
import { Grid2 } from "@mui/material";
export const Render = () => {
  return (
    <>
      <Grid2 container>
      </Grid2>
        <CustomButton
          startIcon={<AddCircle />}
          onClick={() => console.log("Button clicked!")}
        >
          SignIn
        </CustomButton>
      <Grid2>
        <CustomButton
          startIcon={<AddCircle />}
          onClick={() => console.log("Button clicked!")}
        >
          Get Started
        </CustomButton>
      </Grid2>
      <Grid2>
        <CustomButton
          startIcon={<AddCircle />}
          onClick={() => console.log("Button clicked!")}
        >
          Use a sign-in code
        </CustomButton>
      </Grid2>
    </>
  );
};
